import React from 'react'
import { Col } from 'reactstrap';



const DefaultLayout = (photo, label, value) => {
    return (
        <React.Fragment>
            <Col xs="2" >
                <img src={photo} alt={value} width="30px" height="30px" />
            </Col>
            <Col lg="8" xs="1" sm="2"  >
                <div style={{ fontSize: "05rem" }}>{label}</div>
            </Col>
        </React.Fragment>
    )
}

export default DefaultLayout
